import './styles.css';
import Logo from './biomelogo.png';
import Avatar from './biomeavatar.png';
import {BellIcon, ChatIcon, SearchIcon, PlusIcon, ChevronDownIcon} from '@heroicons/react/outline';


function App() {
  return (
    <div>
        <header className="flex w-full bg-biome_dark p-2">
          <div className="mx-4 flex">
            <img src={Logo} alt="" className="w-8 h-8 mr-4"/>
            <form action="" className="bg-biome_dark-brighter px-3 flex rounded-md border border-gray-700 mx-4 flex-grow">
            <SearchIcon className="text-gray-300 h-6 w-6 mt-1"/>
            <input type="text" className="bg-biome_dark-brighter text-sm p-1 pl-2 pr-0 block focus:outline-none text-white" placeholder="Search"/>
          </form>

          <button className="px-2 py-1">
              <ChatIcon className="text-white w-6 h-6 mx-2"/>
          </button>
          <button className="px-2 py-1">
              <BellIcon className="text-white w-6 h-6 mx-2"/>
          </button>
          <button className="px-2 py-1">
              <PlusIcon className="text-white w-6 h-6 mx-2"/>
          </button>

          <button className="bg-gray-600 rounded-md flex">
            <img src={Avatar} alt="" className="block w-8 h-8"/>
            <ChevronDownIcon className="text-gray-500 "/>
          </button>
          </div>

        </header>
    </div>
  );
}

export default App;
